def parseShows(rawShows: List[String]):
Option[List[TvShow]] = {
 val initialResult: Option[List[TvShow]] =
Some(List.empty)
 rawShows
 .map(parseShow)
 .foldLeft(initialResult)(addOrResign)
}
def addOrResign(
 parsedShows:
Option[List[TvShow]],
 newParsedShow:
Option[TvShow]
): Option[List[TvShow]] = {
 for {
 shows <-
parsedShows
 parsedShow <-
newParsedShow
 } yield
shows.appended(parsedShow)
}
